// src/components/Footer.js
import React from 'react';
import styles from './Footer.module.css';

function Footer() {
  return (
    <footer className={styles.footer}>
      <p>&copy; 2024 Mi Empresa. Todos los derechos reservados.</p>
    </footer>
  );
}

export default Footer;
